description.text:
Used Digital machinists calipurs to measure the diameter of ladies finger diameter at widest point:  
Made a 12mm hexagon across the flats;  
Made a 4mm width band that fits young ladies chosen finger.

A quick tool holder that attaches to the 5mm plywood to hold a caliper, tweezers, and 3 hex wrenches.
UPDATE:<br />
After my tool holder broke I updated the design to be stronger. The new part is &quot;tool holder V2.stl&quot;
